import { Component, Vue } from 'vue-property-decorator';
import WDemo from '@/views/components/Demo.vue';
import VueScale from '@/views/components/VueScaleDemo.vue';
// import VueScale from '@/components/VueScale/VueScale.vue';
// import { ApiEntity } from '@/views/entity/demoentity';
// import base from '@/views/code/affix/base.vue';
// import offsettop from '@/views/code/affix/offsettop';
import { props, methods } from '@/views/api/affix';
import { PropsEntity, MethodsEntity } from '@/views/entity/apientity';
import { TITLE } from '@/views/common/constant';

@Component({
  components: {
    WDemo,
    VueScale,
  },
})
export default class AffixView extends Vue {
  Affix: string = TITLE.Affix;

  props: PropsEntity[] = props;

  methods: MethodsEntity[] = methods;

  // eslint-disable-next-line
  moveChange(e) {
    console.log(e, 'moveChangeEmit');
  }

  // eslint-disable-next-line
  scaleChange(e) {
    console.log(e, 'scaleChange');
  }
}
